import React from 'react';
import maxPicture from '../images/max.jpg'

export default function Home() {
    const pictureStyle = {
        display: 'block',
        'margin-left': 'auto',
        'margin-right': 'auto',
        marginTop: '150px',
        height: 'auto',
        width: '40%'
      };

    // Above is CSS code

    return (
        <>
        <img src={maxPicture} className="App-logo" alt="logo" style={pictureStyle} />
        </>
    )
}
